import React, { useCallback, useEffect } from 'react'
import { useParams } from 'react-router-dom'
import { ZegoUIKitPrebuilt} from '@zegocloud/zego-uikit-prebuilt'
import'./MeetPage.css'

const MeetPage = () => {
    const { mroomid } = useParams()
    const myMeeting = async(elem) => {
        const appId = 1110471720
        const serverSecret = "b15d62e6c386417a40eeb4e014b565ca"
        const kitToken = ZegoUIKitPrebuilt.generateKitTokenForTest(
            appId,
            serverSecret,
            mroomid,
            Date.now().toString(),   // user-Id from server
            'Rajesh',    // user-name from server
        )
        const zp = ZegoUIKitPrebuilt.create(kitToken)
        zp.joinRoom({
            container: elem,
            sharedLinks: {
                name: 'Room-Link',
                url: `http://localhost:3000/multimeet/${mroomid}`,
            },
            scenario:{
                mode: ZegoUIKitPrebuilt.VideoConference,
            }
        })
        // zp.on('roomleave',()=>{
        //     window.location.href = 'http://localhost:3000'
        // })
    }
  return (
    <div className='room-page'>
        <div ref={myMeeting} />
    </div>
  )
}

export default MeetPage
